package javaexp.z02_homework.a03_ls.vo;

public class Member {
	int age ;
	String name ;
	public Member() {
		// TODO Auto-generated constructor stub
	}
	public Member(int age, String name) {
		this.age = age;
		this.name = name;
	}
	public int getAge() {
		return age;
	}
	public void setAge(int age) {
		this.age = age;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	
	

}
